import Header from '../components/Header';
import Footer from '../components/Footer';
import Player from '../components/Player';

const Layout = (props) => (
	<div className="App">
		<Header />

		<main>
			{props.children}
		</main>

		<Player />
		
		<Footer />
	</div>
);

export default Layout;
